webpackJsonp([0xc0dd9793ec29],{4750:function(n,a){n.exports={data:{markdownRemark:{html:'<h2>Math Trunc</h2>\n<p><code>Math.trunc()</code> is a method of the Math standard object that returns only the integer part of a given number by simply removing fractional units. This results in an overall rounding towards zero. Any input that is not a number will result in an output of NaN.</p>\n<p>Careful: This method is an ECMAScript 2015 (ES6) feature and thus is not supported by older browsers.</p>\n<h3>Examples</h3>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>Math<span class="token punctuation">.</span><span class="token function">trunc</span><span class="token punctuation">(</span><span class="token number">0.1</span><span class="token punctuation">)</span>   <span class="token comment" spellcheck="true">//  0</span>\nMath<span class="token punctuation">.</span><span class="token function">trunc</span><span class="token punctuation">(</span><span class="token number">1.3</span><span class="token punctuation">)</span>   <span class="token comment" spellcheck="true">//  1</span>\nMath<span class="token punctuation">.</span><span class="token function">trunc</span><span class="token punctuation">(</span><span class="token operator">-</span><span class="token number">0.9</span><span class="token punctuation">)</span>  <span class="token comment" spellcheck="true">// -0</span>\nMath<span class="token punctuation">.</span><span class="token function">trunc</span><span class="token punctuation">(</span><span class="token operator">-</span><span class="token number">1.5</span><span class="token punctuation">)</span>  <span class="token comment" spellcheck="true">// -1</span>\nMath<span class="token punctuation">.</span><span class="token function">trunc</span><span class="token punctuation">(</span><span class="token string">\'foo\'</span><span class="token punctuation">)</span> <span class="token comment" spellcheck="true">// NaN</span>\n</code></pre>\n      </div>\n<h3>More Information:</h3>\n<ul>\n<li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/trunc">MDN</a></li>\n</ul>',fields:{slug:"/javascript/standard-objects/math/math-trunc/"},frontmatter:{title:"Math Trunc"}}},pathContext:{slug:"/javascript/standard-objects/math/math-trunc/"}}}});
